--CLEANUP SCRIPT
set serveroutput on
declare
    v_table_exists varchar(1) := 'Y';
    v_sql varchar(2000);
begin
   dbms_output.put_line('Start schema cleanup');
   for i in (
             select 'REGION' table_name from dual union all
             select 'MOVIE_CAST' table_name from dual union all
             select 'SUBTITLES' table_name from dual union all
             select 'WATCH_HISTORY' table_name from dual union all
             select 'FAVORITE' table_name from dual union all
             select 'DOWNLOAD' table_name from dual union all
             select 'WATCHLIST' table_name from dual union all
             select 'PURCHASE' table_name from dual union all
             select 'SUBSCRIPTION_PLAN' table_name from dual union all
             select 'ACTOR' table_name from dual union all
             select 'ADDRESS' table_name from dual union all
             select 'CUSTOMER' table_name from dual union all
             select 'MOVIE' table_name from dual union all
             select 'GENRE' table_name from dual union all
             select 'DIRECTOR' table_name from dual
   )
   loop
   dbms_output.put_line('....Drop table '||i.table_name);
   begin
       select 'Y' into v_table_exists
       from USER_TABLES
       where TABLE_NAME=i.table_name;

       v_sql := 'drop table '||i.table_name;
       execute immediate v_sql;
       dbms_output.put_line('........Table '||i.table_name||' dropped successfully');
       
   exception
       when no_data_found then
           dbms_output.put_line('........Table already dropped');
       when others then
            dbms_output.put_line('Failed to execute code:'||sqlerrm);
   end;
   end loop;
   dbms_output.put_line('Schema cleanup successfully completed');
exception
   when others then
      dbms_output.put_line('Failed to execute code:'||sqlerrm);
end;


/*
 * Create Table
 */
 /
CREATE TABLE Customer
(
	CustomerID NUMBER NOT NULL PRIMARY KEY,
	UserFirstName VARCHAR(1000) NOT NULL,
	UserLastName VARCHAR(1000) NOT NULL,
	Email VARCHAR(1000) NOT NULL,
	DateOfBirth Date NOT NULL,
	Gender VARCHAR(50) NOT NULL CHECK(GENDER IN ('MALE','FEMALE','OTHER')),
	Username VARCHAR(1000) NOT NULL,
	UserPassword VARCHAR(1000) NOT NULL,
	CustomerStatus VARCHAR(45) NOT NULL CHECK (CustomerStatus IN ('ACTIVE', 'NOT ACTIVE')),
	CreationDate TIMESTAMP NOT NULL
)
/
CREATE TABLE Address
(
	CustomerID INT NOT NULL,
	Address1 VARCHAR(1000) NOT NULL,
	Address2 VARCHAR(1000) NOT NULL,
	City VARCHAR(1000) NOT NULL,
	State VARCHAR(1000) NOT NULL,
	Country VARCHAR(1000) NOT NULL,
	Pincode VARCHAR(1000) NOT NULL,
    CONSTRAINT address_fk FOREIGN KEY (CustomerID) REFERENCES Customer(CustomerID) ON DELETE CASCADE
)
/
CREATE TABLE Director
(
	DirectorID NUMBER NOT NULL PRIMARY KEY,
	DirectorFirstName VARCHAR(1000) NOT NULL,
	DirectorLastName VARCHAR(1000) NOT NULL
)
/
CREATE TABLE Genre
(
	GenreID NUMBER NOT NULL PRIMARY KEY,
	GenreName VARCHAR(1000) NOT NULL
)
/
CREATE TABLE Actor
(
	ActorID NUMBER NOT NULL PRIMARY KEY,
	ActorFirstName VARCHAR(1000) NOT NULL,
	ActorLastName VARCHAR(1000) NOT NULL
)
/
CREATE TABLE Subscription_Plan
(
	PlanID NUMBER NOT NULL PRIMARY KEY,
	PlanName VARCHAR(1000) NOT NULL,
	PlanDescription VARCHAR(1000) NOT NULL,
	ScreenLimit INT NOT NULL
)
/
CREATE TABLE Purchase 
(
	PurchaseID NUMBER NOT NULL PRIMARY KEY,
	PlanID NUMBER NOT NULL,
	CustomerID NUMBER NOT NULL,
	StartDate TIMESTAMP NOT NULL,
	EndDate TIMESTAMP NOT NULL,
    CONSTRAINT purchaseplan_fk FOREIGN KEY (PlanID) REFERENCES Subscription_Plan(PlanID) ON DELETE CASCADE,
    CONSTRAINT purchasecus_fk FOREIGN KEY (CustomerID) REFERENCES Customer(CustomerID) ON DELETE CASCADE
)
/
CREATE TABLE Movie
(
	MovieID NUMBER NOT NULL PRIMARY KEY,
	GenreID NUMBER NOT NULL,
	DirectorID NUMBER NOT NULL,
	MovieTitle VARCHAR(1000) NOT NULL,
	DateOfRelease NUMBER(4) NOT NULL,
	MovieDuration NUMBER(4) NOT NULL,
	MovieDescription VARCHAR(32000) NOT NULL,
	Ratings FLOAT(2),
	CountryOrigin VARCHAR(100) NOT NULL,
    CONSTRAINT moviegenre_fk FOREIGN KEY (GenreID) REFERENCES Genre(GenreID) ON DELETE CASCADE,
    CONSTRAINT moviedirector_fk FOREIGN KEY (DirectorID) REFERENCES Director(DirectorID) ON DELETE CASCADE
)
/
CREATE TABLE Watchlist
(
	WatchlistID NUMBER NOT NULL PRIMARY KEY,
	MovieID NUMBER NOT NULL ,
	CustomerID NUMBER NOT NULL,
    CONSTRAINT watchlistmovie_fk FOREIGN KEY (MovieID) REFERENCES Movie(MovieID) ON DELETE CASCADE,
    CONSTRAINT watchlistcus_fk Foreign KEY (CustomerID) REFERENCES Customer(CustomerID) ON DELETE CASCADE
)
/
CREATE TABLE Download
(
	DownloadID NUMBER NOT NULL PRIMARY KEY,
	MovieID NUMBER NOT NULL,
	CustomerID NUMBER NOT NULL,
	DateOfDownload TIMESTAMP,
    CONSTRAINT downloadmov_fk FOREIGN KEY (MovieID) REFERENCES Movie(MovieID) ON DELETE CASCADE,
    CONSTRAINT downloadcus_fk Foreign KEY (CustomerID) REFERENCES Customer(CustomerID) ON DELETE CASCADE
)
/
CREATE TABLE Favorite
(
	FavoriteID NUMBER NOT NULL PRIMARY KEY,
	MovieID NUMBER NOT NULL,
	CustomerID NUMBER NOT NULL,
    CONSTRAINT favoritemov_fk FOREIGN KEY (MovieID) REFERENCES Movie(MovieID) ON DELETE CASCADE,
    CONSTRAINT favoritecus_fk Foreign KEY (CustomerID) REFERENCES Customer(CustomerID) ON DELETE CASCADE
)
/
CREATE TABLE Watch_History
(
	HistoryID NUMBER NOT NULL PRIMARY KEY,
	MovieID NUMBER NOT NULL,
	CustomerID NUMBER NOT NULL,
    DateWatched DATE,
    CONSTRAINT watch_historymov_fk FOREIGN KEY (MovieID) REFERENCES Movie(MovieID) ON DELETE CASCADE,
    CONSTRAINT watch_historycus_fk FOREIGN KEY (CustomerID) REFERENCES Customer(CustomerID) ON DELETE CASCADE
)
/
CREATE TABLE Subtitles
(
	SubtitlesID NUMBER NOT NULL PRIMARY KEY,
	MovieID NUMBER NOT NULL,
	Text VARCHAR(32000),
	Language VARCHAR(100),
    CONSTRAINT subtitle_fk FOREIGN KEY (MovieID) REFERENCES Movie(MovieID) ON DELETE CASCADE
)
/
CREATE TABLE Movie_Cast
(
	MovieID NUMBER NOT NULL,
	ActorID NUMBER NOT NULL,
    CONSTRAINT moviecastmov_fk FOREIGN KEY (MovieID) REFERENCES Movie(MovieID) ON DELETE CASCADE,
    CONSTRAINT moviecastact_fk FOREIGN KEY (ActorID) REFERENCES Actor(ActorID) ON DELETE CASCADE
)
/
CREATE TABLE Region
(
	RegionID NUMBER NOT NULL PRIMARY KEY,
	MovieID NUMBER NOT NULL,
    RegionName VARCHAR(100),
    CONSTRAINT region_fk FOREIGN KEY (MovieID) REFERENCES Movie(MovieID) ON DELETE CASCADE
)
/
